import React from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import ArrowBackIosRoundedIcon from '@material-ui/icons/ArrowBackIosRounded';
import ArrowForwardIosRoundedIcon from '@material-ui/icons/ArrowForwardIosRounded';
import "./../../../node_modules/flickity/dist/flickity.min.css";


var divStyleImg = {
    borderRadius:'10px',
    height: '410px',
    width: '930px',
};


function Carousel(props) {
    return (
        <div>
            <div id="carouselExampleIndicators" className="carousel slide " data-ride="carousel" data-interval="2500" data-flickity='{ "wrapAround": true, "freeScroll": true, "pageDots": false}'>
                <ol className="carousel-indicators">
                    <li data-target="#carouselExampleIndicators" data-slide-to="0" className="active"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                </ol>
                <div className="carousel-inner carousel-cell">
                    <div className="carousel-item active">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/136095/900x400" alt="First slide" />
                    </div>
                    <div className="carousel-item carousel-cell">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/136095/900x400" alt="Second slide" />
                    </div>
                    <div className="carousel-item carousel-cell">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/136095/900x400" alt="Third slide" />
                    </div>
                </div>
                <a className="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
                    {/* <span className="carousel-control-prev-icon" aria-hidden="true"></span> */}
                    <ArrowBackIosRoundedIcon/>
                    <span className="sr-only">Previous</span>
                </a>
                <a className="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
                    {/* <span className="carousel-control-next-icon" aria-hidden="true"></span> */}
                    <ArrowForwardIosRoundedIcon/>
                    <span className="sr-only">Next</span>
                </a>
            </div>
        </div>
    );
}

export default Carousel;
